/* eslint-disable no-unused-vars */
import { useEffect, useState } from "react";
import galleryImages from "../Frontend/Modules/GalleryImage";
import "./Style/Gallery.css";
import axios from "axios";

function Gallery() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetchImages();
  }, [])

  const fetchImages = () => {
    try {
      const response = axios.get("https://schoolproject.osapplications.com/api/all-gallery-show");
    } catch (error) {
      console.error(error);
      alert("Failed");
    }

    axios
      .get("https://schoolproject.osapplications.com/api/all-gallery-show")
      .then((response) => {
        console.log(response.data);
        setImages(response.data[0])
      })
      .catch((error) => {
        console.log(error);
        alert("Failed");
      });
  };

  return (
    <>
      <div className="image-gallery">
        <div className="gallery">
          <h2>Gallery</h2>
          <div className="gallery-img">
            {images.map((image, index) => (
              <img src={`https://schoolproject.osapplications.com/images/${image.profile}`} key={index} alt={`Gallery-image ${index + 1}`} />
            ))}
          </div>
        </div>
      </div>
    </>
  );
}

export default Gallery;
